         transform="matrix(1,0,-0.01817881,0.99983475,0,0)" /><text
         xml:space="preserve"
         style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:21.6419px;font-family:'KG HAPPY Solid';-inkscape-font-specification:'KG HAPPY Solid';display:inline;fill:#333333;fill-opacity:1;stroke-width:0;stroke-dasharray:none"
         x="28.065075"
         y="900.19312"
         id="text18"><tspan
           sodipodi:role="line"
           id="tspan18"
           x="28.065075"
           y="900.19312"
           style="stroke-width:0">         Pionnier au Maroc et acteur de référence dans l'agro-industrie régionale, </tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="927.24548"
           id="tspan19"
           style="stroke-width:0">     Lesieur Cristal est en première ligne depuis près de 80 ans,</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="954.29785"
           id="tspan20"
           style="stroke-width:0">contribuant à la modernisation des secteurs oléicole et oléagineux au Maroc.</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="981.35022"
           id="tspan46"
           style="stroke-width:0" /><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1008.4026"
           style="stroke-width:0"
           id="tspan73">L'entreprise se positionne également comme le moteur du développement du groupe A</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1035.455"
           style="stroke-width:0"
           id="tspan74">vril sur le continent africain. En capitalisant sur son expertise historique, Lesieur</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1062.5073"
           style="stroke-width:0"
           id="tspan75">Cristal saisit de nombreuses opportunités de croissance dans le domaine des biens de</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1089.5597"
           style="stroke-width:0"
           id="tspan76"> consommation courante.</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1116.6121"
           id="tspan40"
           style="stroke-width:0" /><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1143.6644"
           id="tspan54"
           style="stroke-width:0">De la graine au produit final, Lesieur Cristal se targue d'une infrastructure industrielle</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1170.7168"
           style="stroke-width:0"
           id="tspan78">impressionnante. Cela comprend trois sites de production au Maroc : l'unité de</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1197.7693"
           style="stroke-width:0"
           id="tspan79"> trituration oléagineuse à Aïn Sebaâ, le complexe industriel à Aïn Harrouda, ainsi que</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1224.8217"
           style="stroke-width:0"
           id="tspan80"> l'unité de trituration d'olives à Kelaat Sraghna. En outre, l'entreprise exploite une usine</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1251.874"
           style="stroke-width:0"
           id="tspan81"> de fabrication de margarine (Indusalim) et a établi deux unités en Tunisie</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1278.9264"
           style="stroke-width:0"
           id="tspan82"> (Cristal Tunisie) et au Sénégal (Oleosen).</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1305.9788"
           id="tspan42"
           style="stroke-width:0" /><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1333.0311"
           id="tspan58"
           style="stroke-width:0">L'entreprise produit et distribue une vaste gamme d'huiles de table, d'huiles d'olive, de</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1360.0835"
           style="stroke-width:0"
           id="tspan83">margarines et de savons, qui ont su conquérir l'adhésion et la fidélité renouvelée de</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1387.1359"
           style="stroke-width:0"
           id="tspan84">plusieurs générations de consommateurs. Des marques reconnaissables telles que </tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1414.1882"
           style="stroke-width:0"
           id="tspan85">Lesieur, Cristal, Huilor, Al Horra, Mabrouka, Magdor, Famila, Ledda, Taous, El Kef et El</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1441.2406"
           style="stroke-width:0"
           id="tspan86">Menjel ornent leur gamme de produits.</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1468.293"
           id="tspan44"
           style="stroke-width:0" /><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1495.3453"
           id="tspan63"
           style="stroke-width:0">Consciente de son impact social et environnemental tout en maintenant une</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1522.3977"
           style="stroke-width:0"
           id="tspan87">perspective mondiale, Lesieur Cristal investit dans le perfectionnement de l'expertise</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1549.4501"
           style="stroke-width:0"
           id="tspan88">et de l'engagement envers l'excellence démontrés par ses employés. Ces</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1576.5024"
           style="stroke-width:0"
           id="tspan89">collaborateurs agissent en tant que catalyseurs du progrès dans leurs domaines</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1603.5548"
           style="stroke-width:0"
           id="tspan90">respectifs.</tspan><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1630.6072"
           id="tspan32"
           style="stroke-width:0" /><tspan
           sodipodi:role="line"
           x="28.065075"
           y="1657.6595"
           id="tspan31"
           style="stroke-width:0" /></text><image
