         id="text95"><tspan
           sodipodi:role="line"
           id="tspan95"
           x="94.665367"
           y="1979.411">                                Notre raison d’être, « Servir la Terre », est profondément enracinée dans</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2006.4634"
           id="tspan114">                               la nécessité de relever deux défis cruciaux : l'urgence climatique </tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2033.5157"
           id="tspan115">                             et la croissance démographique. Cette mission est une extension naturelle</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2060.5681"
           id="tspan116">                            de la vision du Groupe Avril et met en lumière notre capacité à agir</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2087.6206"
           id="tspan117">                          quotidiennement en faveur des hommes et des femmes. Pour concrétiser cette</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2114.6729"
           id="tspan118">                                raison d’être, nous souscrivons à six engagements concrets qui soutiennent</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2141.7253"
           id="tspan119">                                   les transitions agricole, alimentaire et environnementale :</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2168.7776"
           id="tspan96" /><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2195.8301"
           id="tspan97">                                   Agir pour une agriculture respectueuse de la planète, en privilégiant des</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2222.8823"
           id="tspan120">                                pratiques agricoles durables et responsables.</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2249.9348"
           id="tspan98" /><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2276.9871"
           id="tspan99">                          Agir pour la protection des ressources naturelles et la préservation de</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2304.0396"
           id="tspan121">                       la biodiversité, en mettant en œuvre des mesures visant à conserver</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2331.0918"
           id="tspan122">               et restaurer les écosystèmes.</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2358.1443"
           id="tspan100" /><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2385.1965"
           id="tspan101">           Agir pour le développement des filières locales, en encourageant les acteurs locaux</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2412.249"
           id="tspan123">                             et en favorisant les circuits courts pour stimuler les économies locales.</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2439.3013"
           id="tspan102" /><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2466.3538"
           id="tspan103">                        Agir pour l'impact de nos investissements, en veillant à ce qu'ils apportent</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2493.406"
           id="tspan124">             une contribution positive aux enjeux sociaux, environnementaux et économiques.</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2520.4585"
           id="tspan104" /><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2547.5107"
           id="tspan105">            Agir pour le climat, en réduisant notre empreinte carbone, en favorisant les énergies</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2574.5632"
           id="tspan125">         renouvelables et en promouvant l'efficacité énergétique.</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2601.6157"
           id="tspan106" /><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2628.668"
           id="tspan107">         Agir pour un projet collectif et inclusif, en encourageant la collaboration, la diversité</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2655.7205"
           id="tspan126">         et l'inclusion dans toutes nos initiatives.</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2682.7727"
           id="tspan108" /><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2709.8252"
           id="tspan109">         Ces engagements incarner notre résolution à façonner un avenir durable, en harmonie</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2736.8774"
           id="tspan127">         avec notre environnement et en répondant aux besoins des générations présentes</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2763.9299"
           id="tspan128">         et futures. Chez Lesieur Cristal, nous sommes fiers de jouer un rôle actif dans</tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2790.9822"
           id="tspan129">         les transitions nécessaires pour préserver notre planète et garantir </tspan><tspan
           sodipodi:role="line"
           x="94.665367"
           y="2818.0347"
           id="tspan130">         un avenir meilleur pour tous.</tspan></text><ellipse
